(3,1,"2019-01-07 18:00:41","2019-01-07 18:00:41","<!-- wp:heading --><h2>Who we are</h2><!-- /wp:heading --><!-- wp:paragraph --><p>Our website address is: http://darien-matt-fitness.local.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>What personal data we collect and why we collect it</h2><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Comments</h3><!-- /wp:heading --><!-- wp:paragraph --><p>When visitors leave comments on the site we collect the data shown in the comments form, and also the visitor&#8217;s IP address and browser user agent string to help spam detection.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>An anonymized string created from your email address (also called a hash) may be provided to the Gravatar service to see if you are using it. The Gravatar service privacy policy is available here: https://automattic.com/privacy/. After approval of your comment, your profile picture is visible to the public in the context of your comment.</p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --><h3>Media</h3><!-- /wp:heading --><!-- wp:paragraph --><p>If you upload images to the website, you should avoid uploading images with embedded location data (EXIF GPS) included. Visitors to the website can download and extract any location data from images on the website.</p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --><h3>Contact forms</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Cookies</h3><!-- /wp:heading --><!-- wp:paragraph --><p>If you leave a comment on our site you may opt-in to saving your name, email address and website in cookies. These are for your convenience so that you do not have to fill in your details again when you leave another comment. These cookies will last for one year.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>If you have an account and you log in to this site, we will set a temporary cookie to determine if your browser accepts cookies. This cookie contains no personal data and is discarded when you close your browser.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>When you log in, we will also set up several cookies to save your login information and your screen display choices. Login cookies last for two days, and screen options cookies last for a year. If you select &quot;Remember Me&quot;, your login will persist for two weeks. If you log out of your account, the login cookies will be removed.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>If you edit or publish an article, an additional cookie will be saved in your browser. This cookie includes no personal data and simply indicates the post ID of the article you just edited. It expires after 1 day.</p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --><h3>Embedded content from other websites</h3><!-- /wp:heading --><!-- wp:paragraph --><p>Articles on this site may include embedded content (e.g. videos, images, articles, etc.). Embedded content from other websites behaves in the exact same way as if the visitor has visited the other website.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>These websites may collect data about you, use cookies, embed additional third-party tracking, and monitor your interaction with that embedded content, including tracking your interaction with the embedded content if you have an account and are logged in to that website.</p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --><h3>Analytics</h3><!-- /wp:heading --><!-- wp:heading --><h2>Who we share your data with</h2><!-- /wp:heading --><!-- wp:heading --><h2>How long we retain your data</h2><!-- /wp:heading --><!-- wp:paragraph --><p>If you leave a comment, the comment and its metadata are retained indefinitely. This is so we can recognize and approve any follow-up comments automatically instead of holding them in a moderation queue.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>For users that register on our website (if any), we also store the personal information they provide in their user profile. All users can see, edit, or delete their personal information at any time (except they cannot change their username). Website administrators can also see and edit that information.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>What rights you have over your data</h2><!-- /wp:heading --><!-- wp:paragraph --><p>If you have an account on this site, or have left comments, you can request to receive an exported file of the personal data we hold about you, including any data you have provided to us. You can also request that we erase any personal data we hold about you. This does not include any data we are obliged to keep for administrative, legal, or security purposes.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Where we send your data</h2><!-- /wp:heading --><!-- wp:paragraph --><p>Visitor comments may be checked through an automated spam detection service.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Your contact information</h2><!-- /wp:heading --><!-- wp:heading --><h2>Additional information</h2><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>How we protect your data</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>What data breach procedures we have in place</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>What third parties we receive data from</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>What automated decision making and/or profiling we do with user data</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Industry regulatory disclosure requirements</h3><!-- /wp:heading -->","Privacy Policy","","draft","closed","open","","privacy-policy","","","2019-01-07 18:00:41","2019-01-07 18:00:41","",0,"http://darien-matt-fitness.local/?page_id=3",12,"page","",0),
(5,1,"2019-01-07 18:21:19","2019-01-07 18:21:19","{\n    \"old_sidebars_widgets_data\": {\n        \"value\": {\n            \"wp_inactive_widgets\": [],\n            \"sidebar-1\": [\n                \"search-2\",\n                \"recent-posts-2\",\n                \"recent-comments-2\",\n                \"archives-2\",\n                \"categories-2\",\n                \"meta-2\"\n            ]\n        },\n        \"type\": \"global_variable\",\n        \"user_id\": 1,\n        \"date_modified_gmt\": \"2019-01-07 18:21:19\"\n    },\n    \"blogdescription\": {\n        \"value\": \"Proud But Never Satisfied\",\n        \"type\": \"option\",\n        \"user_id\": 1,\n        \"date_modified_gmt\": \"2019-01-07 18:21:19\"\n    },\n    \"business_idea_option[business_idea_layout]\": {\n        \"value\": false,\n        \"type\": \"option\",\n        \"user_id\": 1,\n        \"date_modified_gmt\": \"2019-01-07 18:21:19\"\n    }\n}","","","trash","closed","closed","","54cd6bc0-2e6c-445a-96e7-dc6b35da8682","","","2019-01-07 18:21:19","2019-01-07 18:21:19","",0,"http://darien-matt-fitness.local/54cd6bc0-2e6c-445a-96e7-dc6b35da8682/",0,"customize_changeset","",0),
(6,1,"2019-01-07 18:22:58","2019-01-07 18:22:58","<img width=\"749\" height=\"694\" src=\"http://darien-matt-fitness.local/wp-content/uploads/2019/01/change.jpg\" alt=\"\" srcset=\"http://darien-matt-fitness.local/wp-content/uploads/2019/01/change.jpg 749w, http://darien-matt-fitness.local/wp-content/uploads/2019/01/change-300x278.jpg 300w\" sizes=\"(max-width: 749px) 100vw, 749px\" />											\n		<p>When I was young, I was the kid that would do nothing except play video games all day while eating nothing but junk food. McDonald\'s multiple times a week, chips and pop every night and I didn\'t really care for exercise.</p><p>I played baseball for a couple of years when I was around 10 years old and lived back in Richmond Hill, then when I moved to Newmarket I got into Karate for another couple of years. I realized that I really enjoyed physical activity, although my body remained the same due to the foods that I was eating.</p><p>In Grade 10 I decided to take my first Fitness course which introduced to me the gym. I loved just being able to forget about everything for the time I was in there and be able to focus on myself. I didn\'t have much going for me at the time, but I knew that if I stayed persistent with this that I\'d start to see changes.</p><p>Over time I started to notice gradual changes to my body. I started to see muscles forming, vascularity in my arms, you name it! This got me even more motivated to keep pushing.</p><p>In Grade 12, I took my first Nutrition course which gave a basic understanding of foods and what both macro-nutrients &amp; micro-nutrients are. I became hooked on this and finally understood why I stopped seeing more and more changes; my diet was still sub-par.</p><p>I started to apply what I had learned in this course and continued learning about fitness &amp; nutrition over the next 6 years to where I am today.</p><p>I feel like I have learned so much yet I still have so much to learn. I know am I not the most educated man on the planet on this subject, but I have a burning desire to help others achieve success with their bodies as well. There\'re not only physical changes required, but mental changes as well. You have to approach this situation (any situation at that) with a positive mindset and you will be unbelievably shocked at what you can actually achieve.</p>		\n										<img width=\"768\" height=\"686\" src=\"http://darien-matt-fitness.local/wp-content/uploads/2019/01/PhotoSidewalk-768x686.jpg\" alt=\"\" srcset=\"http://darien-matt-fitness.local/wp-content/uploads/2019/01/PhotoSidewalk-768x686.jpg 768w, http://darien-matt-fitness.local/wp-content/uploads/2019/01/PhotoSidewalk-300x268.jpg 300w, http://darien-matt-fitness.local/wp-content/uploads/2019/01/PhotoSidewalk.jpg 893w\" sizes=\"(max-width: 768px) 100vw, 768px\" />											\n							<a href=\"https://twitter.com/darien_matt\" target=\"_blank\">\n					Twitter\n				</a>\n							<a href=\"https://www.instagram.com/darienmatt/\" target=\"_blank\">\n					Instagram\n				</a>","About me","","publish","closed","closed","","about-me","","","2019-01-21 03:49:38","2019-01-21 03:49:38","",0,"http://darien-matt-fitness.local/?page_id=6",6,"page","",0),
