(30,1,"2019-01-07 18:48:14","2019-01-07 18:48:14","<!-- wp:paragraph -->\n<p> \"Proud But Never Satisfied\"<br><br>Ever since I heard Christian say this for the first time years ago it\'s been stuck with me. It\'s awesome to feel proud of what you\'ve achieved in life (work, school, gym, etc) and you always have the opportunity to look back and reflect on these positive traits to motivate yourself to move forward. But reaching satisfaction is truly impossible if you want to keep moving forward. Once you\'re satisfied means you have no reason to keep improving. Life is all about taking risks, learning from your mistakes, and trying to reach satisfaction. In reality, once you\'re there... Are you truly happy? Or do you find yourself wanting more?<br>.<br>Life\'s about the journey and what the road ahead has in store, not the destination. .<br>Thank you so much <a href=\"https://www.instagram.com/kieranpeterson/\">@kieranpeterson</a> for getting this done for me, I\'m super happy with the way it turned out and will definitely be back for another one eventually! </p>\n<!-- /wp:paragraph -->","My Motto","","publish","open","open","","my-motto","","","2019-01-07 18:48:14","2019-01-07 18:48:14","",0,"http://darien-matt-fitness.local/?p=30",2,"post","",0),
