(126,1,"2019-01-17 21:40:46","2019-01-17 21:40:46","<!-- wp:paragraph -->\n<p> Happy Monday! 😁 I\'ve been bulking (in a caloric surplus) for the past 4 months and have made solid gains since then but it\'s time for a mini cut throughout January to clean up the havoc of the Holiday\'s 😅<br>-<br>I\'ll be accountable for ensuring that I stick through this but now you guys can hold me accountable as well. Telling others about a goal that you have is a great way to build confidence in achieving it! You\'re essentially bringing it to life by doing this (if you have an idea but don\'t share it with anyone, it will always just remain an idea 🤷🏻‍♂️)<br>-<br>How\'re you guys starting off the New Year?! 💪 </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->","Monday Funday","","inherit","closed","closed","","23-autosave-v1","","","2019-01-17 21:40:46","2019-01-17 21:40:46","",23,"http://darien-matt-fitness.local/23-autosave-v1/",0,"revision","",0),
