(180,1,"2019-01-18 03:15:52","2019-01-18 03:15:52","<img width=\"749\" height=\"694\" src=\"http://darien-matt-fitness.local/wp-content/uploads/2019/01/change.jpg\" alt=\"\" srcset=\"http://darien-matt-fitness.local/wp-content/uploads/2019/01/change.jpg 749w, http://darien-matt-fitness.local/wp-content/uploads/2019/01/change-300x278.jpg 300w\" sizes=\"(max-width: 749px) 100vw, 749px\" />											\n		<p>When I was young, I was the kid that would do nothing except play video games all day while eating nothing but junk food. McDonald\'s multiple times a week, chips and pop every night and I didn\'t really care for exercise.</p><p> </p><p>I played baseball for a couple of years when I was around 10 years old and lived back in Richmond Hill, then when I moved to Newmarket I got into Karate for another couple of years. I realized that I really enjoyed physical activity, although my body remained the same due to the foods that I was eating.</p><p>In Grade 10 I decided to take my first Fitness course which introduced to me the gym. I loved just being able to forget about everything for the time I was in there and be able to focus on myself. I didn\'t have much going for me at the time, but I knew that if I stayed persistent with this that I\'d start to see changes.</p><p>Over time I started to notice gradual changes to my body. I started to see muscles forming, vascularity in my arms, you name it! This got me even more motivated to keep pushing.</p><p>In Grade 12, I took my first Nutrition course which gave a basic understanding of foods and what both macro-nutrients &amp; micro-nutrients are. I became hooked on this and finally understood why I stopped seeing more and more changes; my diet was still sub-par.</p><p>I started to apply what I had learned in this course and continued learning about fitness &amp; nutrition over the next 6 years to where I am today.</p><p>I feel like I have learned so much yet I still have so much to learn. I know am I not the most educated man on the planet on this subject, but I have a burning desire to help others achieve success with their bodies as well. There\'re not only physical changes required, but mental changes as well. You have to approach this situation (any situation at that) with a positive mindset and you will be unbelievably shocked at what you can actually achieve.</p>		\n										<img width=\"768\" height=\"686\" src=\"http://darien-matt-fitness.local/wp-content/uploads/2019/01/PhotoSidewalk-768x686.jpg\" alt=\"\" srcset=\"http://darien-matt-fitness.local/wp-content/uploads/2019/01/PhotoSidewalk-768x686.jpg 768w, http://darien-matt-fitness.local/wp-content/uploads/2019/01/PhotoSidewalk-300x268.jpg 300w, http://darien-matt-fitness.local/wp-content/uploads/2019/01/PhotoSidewalk.jpg 893w\" sizes=\"(max-width: 768px) 100vw, 768px\" />											\n							<a href=\"https://twitter.com/darien_matt\" target=\"_blank\">\n					Twitter\n				</a>\n							<a href=\"https://www.instagram.com/darienmatt/\" target=\"_blank\">\n					Instagram\n				</a>","About me","","inherit","closed","closed","","6-revision-v1","","","2019-01-18 03:15:52","2019-01-18 03:15:52","",6,"http://darien-matt-fitness.local/6-revision-v1/",0,"revision","",0),
